function topdf(id, time, lat, long, sound, probability) {
    var doc = new jsPDF()
    doc.setFontSize(20);
    doc.setTextColor(255, 255, 255)
    doc.setFont("sans-serif");
    doc.setFontType("bold");
    var toplayer = 'data:image/jpeg;base64,'
    var lowlayer = 'data:image/jpeg;base64,'
    var imgData = 'data:image/jpeg;base64,'
    
    doc.addImage(toplayer, 'JPEG', 0, 0, 400, 60)
    doc.addImage(lowlayer, 'JPEG', 0, 60, 220, 240)
    doc.text(`Event id: ${id}`, 5, 70)
    doc.text(`Date & Time: ${time}`, 5, 90)
    doc.text(`Latitude: ${lat}`, 5, 110)
    doc.text(`Longitude: ${long}`, 5, 130)
    doc.text(`Sound type: ${sound}`, 5, 150)
    doc.text(`Probability: ${probability}%`, 5, 170)
    doc.addImage(imgData, 'JPEG', 36, 5, 135, 50)
    doc.setFontSize(26);
    doc.setTextColor(206, 116, 116);
    doc.textWithLink('Click this link to Google Maps', 15, 200, { url: `https://maps.google.nl/?q=${lat},${long}\n` });
    doc.save(`Event${id}_Time${time}.pdf`)
    doc.download
}